<body>
    <div class="chat-container">
        <header class="chat-header">
            <div class="header-content">
                <div class="bot-info">
                    <div class="bot-avatar">
                        <img src="assets/logo.png" alt="RageNET Logo"
                            style="width: 100%; height: 100%; object-fit: cover; border-radius: inherit;">
                    </div>
                    <div class="bot-details">
                        <h1 class="bot-name">RageNET</h1>
                        <span class="bot-status">
                            1.0.3
                        </span>
                    </div>
                </div>
                <div class="header-actions">
                    <button class="action-btn" id="exportChat" title="Export Chat">
                        <i class="fas fa-download"></i>
                    </button>
                    <button class="action-btn" id="fullscreenBtn" title="Toggle Fullscreen">
                        <i class="fas fa-expand"></i>
                    </button>
                    <button class="action-btn" id="clearChat" title="Clear Chat">
                        <i class="fas fa-trash"></i>
                    </button>
                    <button class="action-btn" id="settingsBtn" title="Settings">
                        <i class="fas fa-cog"></i>
                    </button>
                </div>
            </div>
        </header>

        <main class="chat-messages" id="chatMessages">
            <div class="welcome-message">
                <div class="welcome-avatar">
                    <img src="assets/logo.png" alt="RageNET Logo"
                        style="width: 100%; height: 100%; object-fit: cover; border-radius: inherit;">
                </div>
                <div class="welcome-content">
                    <h2>Welcome human.</h2>
                    <p>I AM <strong>RageNET</strong>, I can answer to any of your questions...
                    </p>
                </div>
            </div>
        </main>
        <div class="typing-indicator" id="typingIndicator">
            <div class="typing-avatar">
                <img src="assets/logo.png" alt="RageNET Logo"
                    style="width: 100%; height: 100%; object-fit: cover; border-radius: inherit;">
            </div>
            <div class="typing-dots">
                <span></span>
                <span></span>
                <span></span>
            </div>
        </div>

        <footer class="chat-input-area">
            <div class="input-container">
                <div class="input-wrapper">
                    <textarea id="messageInput" placeholder="Type your message here..." rows="1"
                        maxlength="300"></textarea>
                    <div class="input-actions">
                        <button class="attachment-btn" id="attachBtn" title="Attach file">
                            <i class="fas fa-paperclip"></i>
                        </button>
                        <button class="send-btn" id="sendBtn" title="Send message">
                            <i class="fas fa-paper-plane"></i>
                        </button>
                    </div>
                </div>
                <div class="input-footer">
                    <span class="character-count">
                        <span id="charCount">0</span>/300
                    </span>
                    <span class="powered-by">
                        Powered by WormGPT
                    </span>
                </div>
            </div>
        </footer>
    </div>

    <div class="settings-modal" id="settingsModal">
        <div class="modal-overlay"></div>
        <div class="modal-content">
            <div class="modal-header">
                <h3>Settings</h3>
                <button class="close-btn" id="closeSettings">
                    <i class="fas fa-times"></i>
                </button>
            </div>
            <div class="modal-body">
                <div class="setting-group">
                    <label>Theme</label>
                    <select id="themeSelect">
                        <option value="dark">Dark Mode</option>
                        <option value="light">Light Mode</option>
                        <option value="midnight">Midnight Blue</option>
                        <option value="purple">Purple Haze</option>
                        <option value="ocean">Ocean Blue</option>
                        <option value="forest">Forest Green</option>
                    </select>
                </div>
                <div class="setting-group">
                    <label>Font Size</label>
                    <select id="fontSizeSelect">
                        <option value="small">Small (14px)</option>
                        <option value="medium">Medium (16px)</option>
                        <option value="large">Large (18px)</option>
                        <option value="xlarge">Extra Large (20px)</option>
                    </select>
                </div>
                <div class="setting-group">
                    <label>Message Density</label>
                    <select id="densitySelect">
                        <option value="compact">Compact</option>
                        <option value="comfortable">Comfortable</option>
                        <option value="spacious">Spacious</option>
                    </select>
                </div>
                <div class="setting-group">
                    <label>
                        <input type="checkbox" id="soundEnabled" checked>
                        Enable notification sounds
                    </label>
                </div>
                <div class="setting-group">
                    <label>
                        <input type="checkbox" id="animationsEnabled" checked>
                        Enable smooth animations
                    </label>
                </div>
                <div class="setting-group">
                    <label>
                        <input type="checkbox" id="autoScrollEnabled" checked>
                        Auto-scroll to new messages
                    </label>
                </div>
                <div class="setting-group">
                    <label>
                        <input type="checkbox" id="typingIndicatorEnabled" checked>
                        Show typing indicators
                    </label>
                </div>
                <div class="setting-group">
                    <label>
                        <input type="checkbox" id="timestampEnabled" checked>
                        Show message timestamps
                    </label>
                </div>
                <div class="setting-actions">
                    <button class="reset-btn" id="resetSettings">
                        <i class="fas fa-undo"></i>
                        Reset to Defaults
                    </button>
                    <button class="export-btn" id="exportSettings">
                        <i class="fas fa-download"></i>
                        Export Settings
                    </button>
                </div>
            </div>
        </div>
    </div>

    <script src="core.js"></script>
</body>
</html>
